"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[53],{1109:e=>{e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"dashboardSidebar":[{"type":"link","label":"Responsible AI Dashboard","href":"/responsible-ai-hub/docs/rai-dashboard-ms-learn","docId":"responsible-ai-dashboard-mslearn/rai-ms-learn","unlisted":false},{"type":"link","label":"Video Walkthrough","href":"/responsible-ai-hub/docs/rai-dashboard-walkthru","docId":"responsible-ai-dashboard-mslearn/rai-dashboard-walkthru","unlisted":false},{"type":"link","label":"Training Materials","href":"/responsible-ai-hub/docs/rai-dashboard-slides","docId":"responsible-ai-dashboard-mslearn/rai-dashboard-slides","unlisted":false}],"contentSafetySidebar":[{"type":"link","label":"Azure Content Safety","href":"/responsible-ai-hub/docs/content-safety-overview","docId":"azure-content-safety/cs-intro","unlisted":false},{"type":"category","label":"Workshop Labs","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"1\ufe0f\u20e3 | Launch GitHub Codespaces","href":"/responsible-ai-hub/docs/content-safety/codespaces","docId":"azure-content-safety/lab-exercises/cs-codespaces-lab1\'","unlisted":false},{"type":"link","label":"2\ufe0f\u20e3 | Create Azure Content Safety","href":"/responsible-ai-hub/docs/content-safety/resource","docId":"azure-content-safety/lab-exercises/content-safety-lab2\'","unlisted":false},{"type":"link","label":"3\ufe0f\u20e3 | Analyze Text","href":"/responsible-ai-hub/docs/content-safety-analyze-text","docId":"azure-content-safety/lab-exercises/cs-analyze-text-lab4\'","unlisted":false},{"type":"link","label":"4\ufe0f\u20e3 | Analyze Image","href":"/responsible-ai-hub/docs/content-safety-analyze-image","docId":"azure-content-safety/lab-exercises/cs-analyze-image-lab4\'","unlisted":false},{"type":"link","label":"5\ufe0f\u20e3 | Azure OpenAI Playground","href":"/responsible-ai-hub/docs/azure-openai-playground","docId":"azure-content-safety/lab-exercises/azure-openai-playground-lab5\'","unlisted":false},{"type":"link","label":"6\ufe0f\u20e3 | OpenAI Playground (optional)","href":"/responsible-ai-hub/docs/openai-playground","docId":"azure-content-safety/lab-exercises/openai-playground-lab5\'","unlisted":false}]},{"type":"link","label":"Video Walkthrough","href":"/responsible-ai-hub/docs/rai-contentsafety-walkthru","docId":"azure-content-safety/rai-contentsafety-walkthru","unlisted":false},{"type":"link","label":"Training Materials","href":"/responsible-ai-hub/docs/rai-contentsafety-slides","docId":"azure-content-safety/rai-contentsafety-slides","unlisted":false}],"promptFlowSidebar":[{"type":"link","label":"Prompt Flow On AzureML","href":"/responsible-ai-hub/docs/prompt-flow-overview","docId":"azure-prompt-flow/pf-intro","unlisted":false},{"type":"category","label":"Workshop Labs","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"1\ufe0f\u20e3 | Build Lab Environment","href":"/responsible-ai-hub/docs/build-workshop-enviroment","docId":"azure-prompt-flow/portal/prompt-flow-lab1","unlisted":false},{"type":"link","label":"2\ufe0f\u20e3 | Bring Your Own Data","href":"/responsible-ai-hub/docs/bring-your-data","docId":"azure-prompt-flow/portal/pf-bring-your-data-lab2\'","unlisted":false},{"type":"link","label":"3\ufe0f\u20e3 | Add Flow Connections","href":"/responsible-ai-hub/docs/add-flow-connections","docId":"azure-prompt-flow/portal/pf-add-flow-connection-lab3\'","unlisted":false},{"type":"link","label":"4\ufe0f\u20e3 | Create Chat Agent","href":"/responsible-ai-hub/docs/create-chatbot-template","docId":"azure-prompt-flow/portal/pf-create-chatbot-template-lab4\'","unlisted":false},{"type":"link","label":"5\ufe0f\u20e3 | Chat With Your Data","href":"/responsible-ai-hub/docs/chatbot-with-your-data","docId":"azure-prompt-flow/portal/pf-chatbot-with-your-data-lab5\'","unlisted":false},{"type":"link","label":"6\ufe0f\u20e3 | Evaluate Chat Agent","href":"/responsible-ai-hub/docs/evaluate-chatbot","docId":"azure-prompt-flow/portal/pf-evaluate-chatbot-lab6\'","unlisted":false}]},{"type":"link","label":"Video Walkthrough","href":"/responsible-ai-hub/docs/rai-promptflow-walkthru","docId":"azure-prompt-flow/rai-promptflow-walkthru","unlisted":false},{"type":"link","label":"Training Materials","href":"/responsible-ai-hub/docs/rai-promptflow-slides","docId":"azure-prompt-flow/rai-promptflow-slides","unlisted":false}]},"docs":{"azure-content-safety/cs-intro":{"id":"azure-content-safety/cs-intro","title":"Azure Content Safety","description":"As we build applications that engage with people, it\u2019s vital that the content that is displayed to the end-user is not harmful or offensive.  In this workshop you will learn how to use the prebuilt AI service, Azure AI Content Safety, in your applications to ensure that the texts or images that are sent to the user or the user enters do not contain data that has violence, self-harm, hate or sexual information.  In addition, based on the demographic of the end-users that interact with the application, developers can control what content is acceptable based on the sensitivity level of the inappropriate content. The services support multiple languages and multiple industries such as gaming, e-commerce, social media, education, etc.","sidebar":"contentSafetySidebar"},"azure-content-safety/lab-exercises/azure-openai-playground-lab5\'":{"id":"azure-content-safety/lab-exercises/azure-openai-playground-lab5\'","title":"5\ufe0f\u20e3 | Azure OpenAI Playground","description":"If you do have Azure OpenAI in your Azure subscription, then you can use this Chat playground. You need an Azure subscription with Azure OpenAI to access the playground. You will need a modern browser - to access both the tutorial and playground.","sidebar":"contentSafetySidebar"},"azure-content-safety/lab-exercises/content-safety-lab2\'":{"id":"azure-content-safety/lab-exercises/content-safety-lab2\'","title":"2\ufe0f\u20e3 | Create Azure Content Safety","description":"To complete this lesson, you would need a Azure OpenAI and Azure AI Content Safety. If you don\'t have OpenAI in your subscription, you\'ll only be creating an Azure AI Content Safety resource.","sidebar":"contentSafetySidebar"},"azure-content-safety/lab-exercises/cs-analyze-image-lab4\'":{"id":"azure-content-safety/lab-exercises/cs-analyze-image-lab4\'","title":"4\ufe0f\u20e3 | Analyze Image","description":"There are tons of applications and social medial sites that enable users to upload images. This opens a flood gate of opportunities for users to upload sexual derogative content, violence, or harmful content. Similar to text, it\u2019s not realistic to rely on users to flag inappropriate content or the staff to manually see the content when it\u2019s uploaded.  Even with manual monitors, images are subjected to each individual evaluator to determine if it is risky.","sidebar":"contentSafetySidebar"},"azure-content-safety/lab-exercises/cs-analyze-text-lab4\'":{"id":"azure-content-safety/lab-exercises/cs-analyze-text-lab4\'","title":"3\ufe0f\u20e3 | Analyze Text","description":"When dealing with text, it is either user or application generated. With Generative AI, we need to be mindful that the text to be examined is either user input prompts or AI generated responses. For example, one of the challenges of using social media or Chat applications to a demographic of high school students is that it introduces system vulnerabilities for users to enter text that have profanity, bullying, harassment, derogatory implications etc.","sidebar":"contentSafetySidebar"},"azure-content-safety/lab-exercises/cs-codespaces-lab1\'":{"id":"azure-content-safety/lab-exercises/cs-codespaces-lab1\'","title":"1\ufe0f\u20e3 | Launch GitHub Codespaces","description":"To expedite running the workspace and having a consistent project environment, we\u2019ll be using GitHub codespaces.","sidebar":"contentSafetySidebar"},"azure-content-safety/lab-exercises/openai-playground-lab5\'":{"id":"azure-content-safety/lab-exercises/openai-playground-lab5\'","title":"6\ufe0f\u20e3 | OpenAI Playground (optional)","description":"If you do not have Azure OpenAI in your Azure subscription, then you can use this Chat playground.","sidebar":"contentSafetySidebar"},"azure-content-safety/rai-contentsafety-slides":{"id":"azure-content-safety/rai-contentsafety-slides","title":"Training Materials","description":"Did you know you can Earn a Facilitator Badge from Credly, that you can put on your LinkedIn profile to show that you completed the Azure Responsible AI Workshop Training? Once you do that, you can then run events to help others skill up and Earn a Course Completion Badge for their professional profiles. Here are some resources to help.","sidebar":"contentSafetySidebar"},"azure-content-safety/rai-contentsafety-walkthru":{"id":"azure-content-safety/rai-contentsafety-walkthru","title":"Video Walkthrough","description":"The Azure AI Content Safety labs takes about an hour to complete end-to-end. It can take longer if you factor in time for exploration and data entry. You might also run into issues or have questions about what should have happened at a specific point in the lab, to help you debug or understand concepts better.","sidebar":"contentSafetySidebar"},"azure-prompt-flow/pf-intro":{"id":"azure-prompt-flow/pf-intro","title":"Prompt Flow On AzureML","description":"Prompt engineering is a tedious process that involves a lot tasks and components.  Developments have next determine what the input or prompts are going to be and what the actions we want in return.  In order to achieve, there are a lot of parts.  For instance, the prompts are responses need to be tokenize.  Next, depending on that the action that will be the output, we need to identify where that information is coming from.  Is the information coming from an API, or an LLM model?  When data is returned, does it need preprocessing?  How is the best response identify?","sidebar":"promptFlowSidebar"},"azure-prompt-flow/portal/pf-add-flow-connection-lab3\'":{"id":"azure-prompt-flow/portal/pf-add-flow-connection-lab3\'","title":"3\ufe0f\u20e3 | Add Flow Connections","description":"Open Azure ML studio to use Prompt Flow.","sidebar":"promptFlowSidebar"},"azure-prompt-flow/portal/pf-bring-your-data-lab2\'":{"id":"azure-prompt-flow/portal/pf-bring-your-data-lab2\'","title":"2\ufe0f\u20e3 | Bring Your Own Data","description":"Open AI and most LLM models are training from various publicly available data.  However, there are instances where we need to use our own data and narrow the actions and data search of our LLM prompts to focus only on the scope of our data or expand the data from LLM model to include our data as well.","sidebar":"promptFlowSidebar"},"azure-prompt-flow/portal/pf-chatbot-with-your-data-lab5\'":{"id":"azure-prompt-flow/portal/pf-chatbot-with-your-data-lab5\'","title":"5\ufe0f\u20e3 | Chat With Your Data","description":"In the precise exercise you create a vector index and train to search for your vector embeddings.  In this exercise, you\u2019ll be expanding the Chat pipeline logic to take the user question .  Then we\u2019ll use the question to search the numeric vector.  Next, we\u2019ll use the prompt to set rules with restrictions and how to display the data to the user.","sidebar":"promptFlowSidebar"},"azure-prompt-flow/portal/pf-create-chatbot-template-lab4\'":{"id":"azure-prompt-flow/portal/pf-create-chatbot-template-lab4\'","title":"4\ufe0f\u20e3 | Create Chat Agent","description":"We will learn how to create a basic chat agent that interacts with prompts power by an OpenAI model.","sidebar":"promptFlowSidebar"},"azure-prompt-flow/portal/pf-evaluate-chatbot-lab6\'":{"id":"azure-prompt-flow/portal/pf-evaluate-chatbot-lab6\'","title":"6\ufe0f\u20e3 | Evaluate Chat Agent","description":"You can unit test your Flow.  However, Prompt flow provides a gallery of sample evaluation flows your can use to test you Flow in bulk.  For example, classification accuracy, QnA Groundedness, QnA Relevant, QnA Similarity, QnA F1 Score etc.  This enables you to test how well your LLM is performing.  In addition, you have the ability to examine which of your variant prompts are performing better.   In this example, we\u2019ll use the QnA Groundedness Evaluation and QnA Relevance Evaluation template to test our flow.","sidebar":"promptFlowSidebar"},"azure-prompt-flow/portal/prompt-flow-lab1":{"id":"azure-prompt-flow/portal/prompt-flow-lab1","title":"1\ufe0f\u20e3 | Build Lab Environment","description":"As you work on creating Flows, it may have dependencies, services or external resources that you would need to connect to, such as OpenAI, Content Safety AI or your custom LLM models.  It enables users to add and manage connection to these resources as well as a their connection secrets (e.g. name, api key, api_endpoint, or type).","sidebar":"promptFlowSidebar"},"azure-prompt-flow/rai-promptflow-slides":{"id":"azure-prompt-flow/rai-promptflow-slides","title":"Training Materials","description":"Did you know you can Earn a Facilitator Badge from Credly, that you can put on your LinkedIn profile to show that you completed the Azure Responsible AI Workshop Training? Once you do that, you can then run events to help others skill up and Earn a Course Completion Badge for their professional profiles. Here are some resources to help.","sidebar":"promptFlowSidebar"},"azure-prompt-flow/rai-promptflow-walkthru":{"id":"azure-prompt-flow/rai-promptflow-walkthru","title":"Video Walkthrough","description":"The Azure ML Prompt Flow labs takes about an hour to complete end-to-end. It can take longer if you factor in time for exploration and data entry. You might also run into issues or have questions about what should have happened at a specific point in the lab, to help you debug or understand concepts better.","sidebar":"promptFlowSidebar"},"badges":{"id":"badges","title":"Claim your badge","description":"Congratulations on completing the Azure Responsible AI workshop!"},"Cleanup":{"id":"Cleanup","title":"Cleanup","description":"Be sure to shutdown the compute instance at the end of this workshop so you do not run out of credits."},"Introduction":{"id":"Introduction","title":"Introduction","description":"AI innovations are growth at a rapid pace.  The the way we design AI systems is poised to transform businesses and society. However, AI systems developed without careful consideration can have unintended harmful consequences. This workshop gives participants hands-on learning on how to use the Responsible AI to debug their machine learning model in order to improve the model\'s performance to be more fair, inclusive, safe & reliable, and transparent. After completing this workshop, participants will learn tools and best practices of using responsible AI to produce AI solutions that are less harmful to society and more trustworthy."},"References":{"id":"References","title":"Tutorials","description":"To get a deeper understanding of all the Responsible AI dashboard features and components, refer to the following tutorials series:"},"responsible-ai-dashboard-mslearn/rai-dashboard-slides":{"id":"responsible-ai-dashboard-mslearn/rai-dashboard-slides","title":"Training Materials","description":"Did you know you can Earn a Facilitator Badge from Credly, that you can put on your LinkedIn profile to show that you completed the Azure Responsible AI Workshop Training? Once you do that, you can then run events to help others skill up and Earn a Course Completion Badge for their professional profiles. Here are some resources to help.","sidebar":"dashboardSidebar"},"responsible-ai-dashboard-mslearn/rai-dashboard-walkthru":{"id":"responsible-ai-dashboard-mslearn/rai-dashboard-walkthru","title":"Video Walkthrough","description":"The Responsible AI Dashboard Learn Module takes about an hour to complete end-to-end. It can take longer if you factor in time for exploration and data entry. You might also run into issues or have questions about what should have happened at a specific point in the lab, to help you debug or understand concepts better.","sidebar":"dashboardSidebar"},"responsible-ai-dashboard-mslearn/rai-ms-learn":{"id":"responsible-ai-dashboard-mslearn/rai-ms-learn","title":"Responsible AI Dashboard","description":"In this session, you\'ll complete a hands-on lab that will teach you how to debug an AI model using the Responsible AI Dashboard in Azure Machine Learning Studio, to ensure that  it performs responsibly and is less harmful.","sidebar":"dashboardSidebar"},"Survey":{"id":"Survey","title":"Survey","description":"Congratulations on completing the workshop! We hope you enjoyed the experience and learned a lot about the Responsible AI dashboard. We would love to hear your feedback on the training. Please take a few minutes to complete the survey below."}}}')}}]);